// SecureRandom.setSeed(byte[]) can be used to seed a secure random number generator. 
// The seed bytes are used by the SecureRandom implementation to seed the random number generator.
// The seed bytes can be obtained from a random source or generated by an application.
// For example, the seed bytes can be generated by calling the java.security.SecureRandom.generateSeed method. 
// The seed bytes will be used by the SecureRandom implementation only once, when the SecureRandom object is created. 
// After that, the SecureRandom object will use its own internal state to generate random bytes. 
// The SecureRandom.setSeed method is provided for compatibility with older code.
// Note that the SecureRandom implementation may ignore the seed bytes. 
// For example, the SHA1PRNG algorithm used by the Sun provider ignores the seed bytes. 
// In that case, the SecureRandom.setSeed method will not affect the output of the SecureRandom.generateSeed method.


// The java.security.SecureRandom.setSeed(byte[]) method is used to set the seed of this random number generator using a single byte.
// Syntax
//

if (source != null) {
	InputStream inputStream = source.getInputStream();
	try {
		byte[] sourceBytes = FileCopyUtils.copyToByteArray(inputStream);
		secureRandomInstance.setSeed(sourceBytes);
	} finally {
		inputStream.close();
	}
} else {
	secureRandomInstance.nextBytes(new byte[1]);
}

